import logo from './logo.svg';
import './App.css';
import Styled from 'styled-components';

const Logo = Styled.div `
  img {
    width: 100px;
    display: flex;
    margin-left: 2rem;
    margin-top: 2rem;
  }
`;

const Banner = Styled.div `
    display: flex;
    width: 100%;
    height: 30rem;
    background: url('./racing.jpg');
    background-position: center;
    background-repeat: no-repeat;
    background-size: cover;
`;

function App() {
  return (
    <div className="App">
      <header>
        <Logo><img src="./logo.png" /></Logo>
        <nav>
          <ul>
            <li>Home</li>
            <li>Fixtures</li>
            <li>Podcasts</li>
            <li>Players</li>
            <li>About Us</li>
          </ul>
        </nav>
        <Banner/>
        </header>
        <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
    </div>
  );
}

export default App;
